import video from '../src/assets/blue_bg.mp4';

 function BgVideo() {
    return (
        <div className="bgContainer">
            <div className="overlay">
                <video src={video} autoPlay loop muted />
            </div>
        </div>
    );
} 

export default BgVideo;
